09-step-08-wikidata-images.html.body:
Step 8: Wikidata Images
Live Demo: html/cog_map_step_08.html

Overview
In this step, we'll enhance our application by fetching and displaying images of the artworks from Wikimedia Commons. Images make our application much more engaging and informative!
Learning Objectives

Access Wikidata properties (specifically P18 for images)
Construct Wikimedia Commons image URLs
Work with helper functions for code organization
Handle cases where images might not exist
Display images in HTML dynamically
Understand Wikimedia Commons URL structure

What is Wikimedia Commons?
Wikimedia Commons is a free media repository containing millions of freely usable images, videos, and other media files.
Key facts:

Over 90 million files
All files are free to use (various open licenses)
Sister project to Wikipedia
Integrated with Wikidata

Connection to Wikidata:

Wikidata items can link to Commons files
Property P18 = "image" (the main image for an item)
Files stored on Commons, references stored in Wikidata

Understanding Wikidata Properties
Wikidata uses a property system where each type of information has a unique identifier:



Property
Name
Description
Example Value




P18
image
Main image of the subject
"Gay Liberation sculpture 04.jpg"


P170
creator
Creator of the work
Mark di Suvero


P571
inception
Date when created
1985


P186
material
What it's made from
Steel


P276
location
Where it is located
Stanford University



Property P18 (image) is what we'll focus on in this step.
The Complete Code






    Stanford Campus Map - Step 8: Add Wikidata Images











Stanford Public Art Map
Step 8: Add Wikidata images from Wikimedia Commons






        Click on an artwork to see Wikidata information





    const map = L.map('map').setView([37.427, -122.169], 15);

    const tiles = L.tileLayer('https://tile.openstreetmap.org/{z}/{x}/{y}.png', {
        maxZoom: 19,
        attribution: '&copy; OpenStreetMap'
    }).addTo(map);

    // Helper function to get the image URL from Wikidata entity
    function getWikidataImage(entity) {
        // Check if the entity has any claims (properties)
        if (!entity.claims) return null;

        // Look for property P18 (image)
        const imageClaims = entity.claims.P18;

        // Check if P18 exists and has values
        if (!imageClaims || imageClaims.length === 0) return null;

        // Get the first image filename from the claims
        const imageFilename = imageClaims[0].mainsnak.datavalue.value;

        // Construct the Wikimedia Commons URL
        // Special:FilePath automatically redirects to the actual image file
        return `https://commons.wikimedia.org/wiki/Special:FilePath/${encodeURIComponent(imageFilename)}`;
    }

    // Function to fetch and display Wikidata content with images
    async function displayWikidataInfo(wikidataId) {
        const panel = document.getElementById('wikidata-panel');

        try {
            // Fetch the Wikidata entity in JSON format
            const response = await fetch(`https://www.wikidata.org/wiki/Special:EntityData/${wikidataId}.json`);
            const data = await response.json();
            const entity = data.entities[wikidataId];

            // Check if entity was found
            if (!entity) {
                panel.innerHTML = 'Wikidata not found';
                return;
            }

            // Begin building the HTML content
            let html = '';

            // Get and display the image if available
            const imageUrl = getWikidataImage(entity);
            if (imageUrl) {
                html += ``;
            }

            // Extract and display the label (name)
            const label = entity.labels.en ? entity.labels.en.value : wikidataId;
            html += `${label}`;

            // Extract and display the description
            if (entity.descriptions.en) {
                html += `${entity.descriptions.en.value}`;
            }

            // Link to view the full Wikidata page
            html += `View on Wikidata`;

            // Close the div and update the panel
            html += '';
            panel.innerHTML = html;
        } catch (error) {
            console.error('Error fetching Wikidata:', error);
            panel.innerHTML = 'Error loading Wikidata information';
        }
    }

    var url_to_geotiff_file = new URL("collection/stanford_campus_irg.tif", window.location.href).href;

    parseGeoraster(url_to_geotiff_file).then(georaster => {
      console.log("georaster:", georaster);

      fetch("collection/stanford_campus.geojson")
        .then(r => r.json())
        .then(maskGeojson => {
          var layer = new GeoRasterLayer({
            attribution: "Planet",
            georaster: georaster,
            resolution: 128,
            mask: maskGeojson
          });

          layer.addTo(map);
          map.fitBounds(layer.getBounds());
        });
    }).catch(console.error);

    fetch('collection/stanford_public_art.geojson')
        .then(response => response.json())
        .then(data => {
            const artworkLayer = L.geoJSON(data, {
                pointToLayer: function(feature, latlng) {
                    return L.circleMarker(latlng, {
                        radius: 6,
                        color: 'white',
                        weight: 2,
                        fillColor: 'blue',
                        fillOpacity: 0.7
                    });
                },
                onEachFeature: function(feature, layer) {
                    const props = feature.properties || {};
                    const title = props.name || 'Artwork';
                    const artist = props.artist_name;
                    const type = props.artwork_type;

                    let popupContent = '';
                    popupContent += '' + title + '';
                    if (artist) popupContent += 'Artist: ' + artist + '';
                    if (type) popupContent += 'Type: ' + type;
                    popupContent += '';

                    layer.bindPopup(popupContent);

                    // Add click handler to display Wikidata info
                    layer.on('click', function() {
                        if (props.wikidata) {
                            displayWikidataInfo(props.wikidata);
                        } else {
                            document.getElementById('wikidata-panel').innerHTML = 'No Wikidata ID available for this artwork';
                        }
                    });
                }
            }).addTo(map);

            map.fitBounds(artworkLayer.getBounds());
        })
        .catch(error => console.error('Error loading GeoJSON:', error));






What's New?
1. Helper Function: getWikidataImage()
function getWikidataImage(entity) {
    if (!entity.claims) return null;

    const imageClaims = entity.claims.P18;

    if (!imageClaims || imageClaims.length === 0) return null;

    const imageFilename = imageClaims[0].mainsnak.datavalue.value;

    return `https://commons.wikimedia.org/wiki/Special:FilePath/${encodeURIComponent(imageFilename)}`;
}

What is a helper function?

A function that performs a specific, reusable task
Makes main code cleaner and easier to read
Can be tested independently
Promotes code reusability

Why create this helper?

Image extraction logic is complex
We might want to get images for multiple items
Separates concerns (image handling vs. display)
Easier to modify or debug later

2. Understanding Wikidata Claims Structure
Wikidata entities have this structure:
{
  "entities": {
    "Q47522966": {
      "labels": { "en": { "value": "The Sieve..." } },
      "descriptions": { "en": { "value": "sculpture..." } },
      "claims": {
        "P18": [
          {
            "mainsnak": {
              "datavalue": {
                "value": "The Sieve of Eratosthenes by Mark di Suvero.jpg"
              }
            }
          }
        ],
        "P170": [...],
        "P571": [...]
      }
    }
  }
}

Breaking down the structure:

claims - Object containing all properties
P18 - Array of image claims (usually just one)
[0] - Get the first claim
.mainsnak.datavalue.value - The actual filename

3. Checking for Existence
if (!entity.claims) return null;

Defensive programming - Always check if data exists before using it.
What could go wrong:

Entity might have no claims at all
P18 property might not exist
P18 array might be empty
datavalue might be missing

Each check prevents an error:
if (!entity.claims) return null;                        // Prevent: entity.claims.P18 when claims is undefined
if (!imageClaims || imageClaims.length === 0) return null;  // Prevent: accessing [0] on empty array

Return null = "No image available" (not an error, just missing data)
4. Getting Nested Array Data
const imageFilename = imageClaims[0].mainsnak.datavalue.value;

Why [0]? Some properties can have multiple values. P18 usually has just one image, so we take the first.
Path to the filename:
imageClaims           // Array of claims
  [0]                // First claim
    .mainsnak        // Main value (vs. qualifiers or references)
      .datavalue     // The actual data
        .value       // The filename string
5. Constructing Wikimedia Commons URLs
return `https://commons.wikimedia.org/wiki/Special:FilePath/${encodeURIComponent(imageFilename)}`;

Special:FilePath is a magic Wikimedia endpoint that:

Accepts a filename
Returns the actual image file (not the page)
Handles redirects automatically
Works with any size/format

Example:
Filename: "Gay Liberation sculpture 04.jpg"
URL: https://commons.wikimedia.org/wiki/Special:FilePath/Gay%20Liberation%20sculpture%2004.jpg
Result: Redirects to actual image file
6. URL Encoding
encodeURIComponent(imageFilename)

Why encode URLs?

Filenames can contain spaces, special characters
URLs need special characters escaped
Prevents broken links

Examples:
encodeURIComponent("Artwork Image.jpg")
// Returns: "Artwork%20Image.jpg"

encodeURIComponent("Sculpture #5 (2020).jpg")
// Returns: "Sculpture%20%235%20(2020).jpg"

Characters that get encoded:

Space → %20
# → %23
& → %26
/ → %2F

7. Displaying the Image
const imageUrl = getWikidataImage(entity);
if (imageUrl) {
    html += ``;
}

If imageUrl is null (no image available), we skip adding the  tag.
The img tag:

src - URL where the image is located
alt - Text description (for accessibility, if image fails to load)
class - CSS class for styling (defined in styles_wikidata.css)

CSS styling (in styles_wikidata.css):
.wikidata-image {
    width: 100%;
    height: auto;
    margin-bottom: 15px;
    border-radius: 8px;
}

Image Loading Flow
Step-by-step what happens:

User clicks marker with Wikidata ID "Q47522966"
displayWikidataInfo() called
Fetch Wikidata entity data
Parse JSON response
Call getWikidataImage(entity)
Check if claims exist → ✓
Check if P18 exists → ✓
Extract filename → "The Sieve of Eratosthenes by Mark di Suvero.jpg"
Encode filename → "The%20Sieve%20of%20Eratosthenes%20by%20Mark%20di%20Suvero.jpg"
Construct URL → "https://commons.wikimedia.org/wiki/Special:FilePath/The%20Sieve..."
Return URL


Add  to HTML with that URL
Update panel with new HTML
Browser requests image from Wikimedia Commons
Image displays in the panel

Working with Wikimedia Commons
File naming on Commons:

Descriptive names: "Gay Liberation sculpture 04.jpg"
Multiple versions: "Sculpture_01.jpg", "Sculpture_02.jpg"
Uploaded by users worldwide
Can be renamed by administrators

Image licenses:

Public domain
Creative Commons (CC BY, CC BY-SA, etc.)
Free to use for any purpose
Attribution requirements vary

Image resolution:

Special:FilePath returns full resolution
Can specify width: Special:FilePath/image.jpg?width=500
Commons stores multiple sizes

Try It Yourself

Copy the complete code into a file named step-08.html
Ensure you have styles_wikidata.css in the same directory
Open in your browser
Click on artworks

You should now see images appear!
Experiments
Test the helper function in the console:
// Manually test with a known entity
fetch('https://www.wikidata.org/wiki/Special:EntityData/Q47522966.json')
    .then(r => r.json())
    .then(data => {
        const entity = data.entities.Q47522966;
        console.log('Image URL:', getWikidataImage(entity));
    });

Try different image sizes:
// Modify the helper function to accept a width parameter
function getWikidataImage(entity, width = null) {
    // ... existing code ...

    let url = `https://commons.wikimedia.org/wiki/Special:FilePath/${encodeURIComponent(imageFilename)}`;
    if (width) {
        url += `?width=${width}`;
    }
    return url;
}

// Use it:
const imageUrl = getWikidataImage(entity, 500);  // 500px wide

Handle missing images gracefully:
if (imageUrl) {
    html += ``;
} else {
    html += `No image available`;
}

Add an image placeholder while loading:
html += ``;

Code Organization Best Practices
Why separate helper functions?
Before (everything in one function):
async function displayWikidataInfo(wikidataId) {
    // ... fetch code ...

    // Image extraction logic mixed in
    if (entity.claims && entity.claims.P18 && entity.claims.P18.length > 0) {
        const imageFilename = entity.claims.P18[0].mainsnak.datavalue.value;
        const imageUrl = `https://commons.wikimedia.org/wiki/Special:FilePath/${encodeURIComponent(imageFilename)}`;
        html += ``;
    }

    // ... more display code ...
}

After (with helper):
async function displayWikidataInfo(wikidataId) {
    // ... fetch code ...

    const imageUrl = getWikidataImage(entity);
    if (imageUrl) {
        html += ``;
    }

    // ... more display code ...
}

function getWikidataImage(entity) {
    // All image logic isolated here
}

Benefits:

Easier to read and understand  
Can test getWikidataImage() independently  
Can reuse for multiple items  
Changes to image logic are isolated  
Main function stays focused on display  

Connection to Digital Stacks
This works perfectly with SDR deposits because:

External resources (Wikimedia images) load from anywhere
No CORS issues - Commons serves images with permissive headers
Relative paths still work for your GeoJSON/data
JavaScript executes client-side in the user's browser

Example deployed to SDR (DRUID: abc123xyz456):
https://stacks.stanford.edu/file/druid:abc123xyz456/index.html
│
├── Loads: styles_wikidata.css (relative path) ✓
├── Loads: collection/stanford_public_art.geojson (relative path) ✓
├── Calls: Wikidata API (external, absolute URL) ✓
└── Loads: Wikimedia Commons images (external, absolute URL) ✓
All four work together seamlessly!
Related resources:

Stanford Digital Repository: https://sdr.stanford.edu/
Stanford Libraries APIs: https://api.library.stanford.edu/
Stanford Geospatial Center: https://gis.stanford.edu/

What's Next?
In Step 9: Complete Integration, we'll add even more Wikidata properties like artist names, dates, and materials to create a fully-featured artwork information display!
Key Takeaways

Helper functions isolate complex logic and improve code organization  
Wikidata properties (like P18) are accessed through the claims structure  
Always check if data exists before accessing nested properties  
Wikimedia Commons provides free images accessible via Special:FilePath  
URL encoding prevents broken links with special characters  
External image resources work seamlessly with SDR-hosted applications  
Images make applications more engaging and informative  

Common Questions
Q: What if an item has no image?A: The helper returns null, and we simply don't add an  tag. No error occurs.
Q: Can I use images from other sources?A: Yes, but be careful about:

Copyright/licensing
CORS policies (some servers block cross-origin requests)
Reliability (Commons is very stable)

Q: Why not download and include images in my deposit?A: You could, but:

Images can be large (increases deposit size)
Images might update on Commons
Using live links ensures latest versions
Commons handles hosting/bandwidth

Q: Can I specify image size?A: Yes! Add ?width=500 to the URL: Special:FilePath/image.jpg?width=500
Q: What if the image fails to load?A: Use the onerror attribute: 
Q: Are there other image properties besides P18?A: Yes! P154 (logo), P41 (flag), P94 (coat of arms), etc. P18 is the main image.

Previous: Step 7: Basic Wikidata | Next: Step 9: Complete Integration

10-step-09-complete-integration.html.body:
Step 9: Complete Integration
Live Demo: html/cog_map_step_09.html

Overview
In this final step, we'll create a fully-featured application by adding multiple Wikidata properties: artist names, creation dates, materials, and more. This demonstrates how to build a comprehensive information display from structured data.
Learning Objectives

Extract multiple properties from Wikidata entities
Create reusable helper functions for different data types
Handle entity references (links to other Wikidata items)
Format dates and complex data for display
Build rich, multi-faceted information panels
Understand Wikidata's linked data structure

Common Wikidata Properties for Artworks



Property
ID
Data Type
Example




Image
P18
File
"Sculpture_photo.jpg"


Creator
P170
Item (person)
Mark di Suvero (Q315277)


Discoverer or inventor
P61
Item (person)
George Segal (Q500837)


Inception
P571
Date
1980


Material
P186
Item
Bronze (Q34095)


Location
P276
Item
Stanford University (Q5083)


Genre
P136
Item
Public art (Q557141)


Height
P2048
Quantity
4.5 meters


Width
P2049
Quantity
3 meters



Understanding item references:

Properties like P170 (creator) don't store the name directly
They store a reference to another Wikidata item
We need to fetch that item to get the label (name)
This is called "linked data"

The Complete Code






    Stanford Campus Map - Step 9: Complete Wikidata Integration











Stanford Public Art Map
Step 9: Complete integration with all Wikidata properties






        Click on an artwork to see Wikidata information





    const map = L.map('map').setView([37.427, -122.169], 15);

    const tiles = L.tileLayer('https://tile.openstreetmap.org/{z}/{x}/{y}.png', {
        maxZoom: 19,
        attribution: '&copy; OpenStreetMap'
    }).addTo(map);

    // Helper function to fetch a label for a Wikidata item
    async function getWikidataLabel(itemId) {
        try {
            const response = await fetch(`https://www.wikidata.org/wiki/Special:EntityData/${itemId}.json`);
            const data = await response.json();
            const entity = data.entities[itemId];

            // Return English label if available, otherwise return the item ID
            return entity.labels.en ? entity.labels.en.value : itemId;
        } catch (error) {
            console.error(`Error fetching label for ${itemId}:`, error);
            return itemId;
        }
    }

    // Helper function to get the image URL from Wikidata entity
    function getWikidataImage(entity) {
        // Check if the entity has any claims (properties)
        if (!entity.claims) return null;

        // Look for property P18 (image)
        const imageClaims = entity.claims.P18;

        // Check if P18 exists and has values
        if (!imageClaims || imageClaims.length === 0) return null;

        // Get the first image filename from the claims
        const imageFilename = imageClaims[0].mainsnak.datavalue.value;

        // Construct the Wikimedia Commons URL
        return `https://commons.wikimedia.org/wiki/Special:FilePath/${encodeURIComponent(imageFilename)}`;
    }

    // Function to fetch and display complete Wikidata content
    async function displayWikidataInfo(wikidataId) {
        const panel = document.getElementById('wikidata-panel');

        try {
            // Fetch the Wikidata entity in JSON format
            const response = await fetch(`https://www.wikidata.org/wiki/Special:EntityData/${wikidataId}.json`);
            const data = await response.json();
            const entity = data.entities[wikidataId];

            // Check if entity was found
            if (!entity) {
                panel.innerHTML = 'Wikidata not found';
                return;
            }

            // Begin building the HTML content
            let html = '';

            // Get and display the image if available
            const imageUrl = getWikidataImage(entity);
            if (imageUrl) {
                html += ``;
            }

            // Extract and display the label (name)
            const label = entity.labels.en ? entity.labels.en.value : wikidataId;
            html += `${label}`;

            // Extract and display the description
            if (entity.descriptions.en) {
                html += `${entity.descriptions.en.value}`;
            }

            // Extract and display the creator (P170)
            if (entity.claims.P170) {
                const creatorId = entity.claims.P170[0].mainsnak.datavalue.value.id;
                const creatorName = await getWikidataLabel(creatorId);
                html += `Creator: ${creatorName}`;
            }

            // Extract and display the discoverer or inventor (P61) - used for some sculptures
            if (entity.claims.P61) {
                const inventorId = entity.claims.P61[0].mainsnak.datavalue.value.id;
                const inventorName = await getWikidataLabel(inventorId);
                html += `Artist: ${inventorName}`;
            }

            // Extract and display inception date (P571)
            if (entity.claims.P571) {
                const dateValue = entity.claims.P571[0].mainsnak.datavalue.value.time;
                // Wikidata dates are in format: +1980-01-01T00:00:00Z
                // Extract the year
                const year = dateValue.match(/[+-](\d{4})/)[1];
                html += `Date: ${year}`;
            }

            // Extract and display material (P186)
            if (entity.claims.P186) {
                const materials = [];
                // Loop through all materials (there might be multiple)
                for (let claim of entity.claims.P186) {
                    const materialId = claim.mainsnak.datavalue.value.id;
                    const materialName = await getWikidataLabel(materialId);
                    materials.push(`${materialName}`);
                }
                html += `Material: ${materials.join(', ')}`;
            }

            // Link to view the full Wikidata page
            html += `View on Wikidata`;

            // Close the div and update the panel
            html += '';
            panel.innerHTML = html;
        } catch (error) {
            console.error('Error fetching Wikidata:', error);
            panel.innerHTML = 'Error loading Wikidata information';
        }
    }

    var url_to_geotiff_file = new URL("collection/stanford_campus_irg.tif", window.location.href).href;

    parseGeoraster(url_to_geotiff_file).then(georaster => {
      console.log("georaster:", georaster);

      fetch("collection/stanford_campus.geojson")
        .then(r => r.json())
        .then(maskGeojson => {
          var layer = new GeoRasterLayer({
            attribution: "Planet",
            georaster: georaster,
            resolution: 128,
            mask: maskGeojson
          });

          layer.addTo(map);
          map.fitBounds(layer.getBounds());
        });
    }).catch(console.error);

    fetch('collection/stanford_public_art.geojson')
        .then(response => response.json())
        .then(data => {
            const artworkLayer = L.geoJSON(data, {
                pointToLayer: function(feature, latlng) {
                    return L.circleMarker(latlng, {
                        radius: 6,
                        color: 'white',
                        weight: 2,
                        fillColor: 'blue',
                        fillOpacity: 0.7
                    });
                },
                onEachFeature: function(feature, layer) {
                    const props = feature.properties || {};
                    const title = props.name || 'Artwork';
                    const artist = props.artist_name;
                    const type = props.artwork_type;

                    let popupContent = '';
                    popupContent += '' + title + '';
                    if (artist) popupContent += 'Artist: ' + artist + '';
                    if (type) popupContent += 'Type: ' + type;
                    popupContent += '';

                    layer.bindPopup(popupContent);

                    // Add click handler to display Wikidata info
                    layer.on('click', function() {
                        if (props.wikidata) {
                            displayWikidataInfo(props.wikidata);
                        } else {
                            document.getElementById('wikidata-panel').innerHTML = 'No Wikidata ID available for this artwork';
                        }
                    });
                }
            }).addTo(map);

            map.fitBounds(artworkLayer.getBounds());
        })
        .catch(error => console.error('Error loading GeoJSON:', error));






What's New?
1. The getWikidataLabel() Helper Function
async function getWikidataLabel(itemId) {
    try {
        const response = await fetch(`https://www.wikidata.org/wiki/Special:EntityData/${itemId}.json`);
        const data = await response.json();
        const entity = data.entities[itemId];

        return entity.labels.en ? entity.labels.en.value : itemId;
    } catch (error) {
        console.error(`Error fetching label for ${itemId}:`, error);
        return itemId;
    }
}

Why do we need this?
When we access properties like P170 (creator), we get a reference to another item, not the name:
// We get this:
{
  "datavalue": {
    "value": {
      "id": "Q315277"
    }
  }
}

// But we want this:
"Mark di Suvero"

This helper:

Takes a Wikidata item ID (like "Q315277")
Fetches that item's data
Extracts the English label
Returns the human-readable name

It's async because it makes a network request.
2. Linked Data and Entity References
Wikidata uses linked data - items link to other items:
"Gay Liberation" (Q16270988)
    ↓
    P170 (creator)
    ↓
    George Segal (Q500837)
In the JSON:
entity.claims.P170[0].mainsnak.datavalue.value.id
// Returns: "Q500837"

To get the name, we fetch Q500837:
const creatorName = await getWikidataLabel("Q500837");
// Returns: "George Segal"

3. Extracting Creator Information (P170)
if (entity.claims.P170) {
    const creatorId = entity.claims.P170[0].mainsnak.datavalue.value.id;
    const creatorName = await getWikidataLabel(creatorId);
    html += `Creator: ${creatorName}`;
}

Step by step:

Check if P170 exists
Extract the item ID from the first claim
Fetch the label for that item ID
Build HTML with the name and a link to the creator's Wikidata page

Why await? The getWikidataLabel() function is asynchronous - it needs to fetch data from the API.
4. Handling Multiple Properties (P61)
if (entity.claims.P61) {
    const inventorId = entity.claims.P61[0].mainsnak.datavalue.value.id;
    const inventorName = await getWikidataLabel(inventorId);
    html += `Artist: ${inventorName}`;
}

Why check for P61? Different items use different properties:

P170 = Creator (general)
P61 = Discoverer or inventor (sometimes used for sculptures)

Some artworks use one, some use the other, some use both.
5. Date Extraction and Formatting (P571)
if (entity.claims.P571) {
    const dateValue = entity.claims.P571[0].mainsnak.datavalue.value.time;
    const year = dateValue.match(/[+-](\d{4})/)[1];
    html += `Date: ${year}`;
}

Wikidata date format:
"+1980-01-01T00:00:00Z"
Components:

+ or - = BCE/CE
1980 = Year
01-01 = Month and day
T00:00:00Z = Time (usually 00:00:00 for dates)

Using regex to extract the year:
dateValue.match(/[+-](\d{4})/)

Breakdown:

/[+-] = Match + or -
(\d{4}) = Capture 4 digits (the year)
[1] = Get the first capture group (the year)

Why just the year? Often that's all we need, and it's simpler to display.
More complex date handling:
// Extract full date
const dateMatch = dateValue.match(/([+-])(\d{4})-(\d{2})-(\d{2})/);
const era = dateMatch[1] === '+' ? 'CE' : 'BCE';
const year = dateMatch[2];
const month = dateMatch[3];
const day = dateMatch[4];

html += `Date: ${year}-${month}-${day} ${era}`;

6. Handling Multiple Values (Materials)
if (entity.claims.P186) {
    const materials = [];
    for (let claim of entity.claims.P186) {
        const materialId = claim.mainsnak.datavalue.value.id;
        const materialName = await getWikidataLabel(materialId);
        materials.push(`${materialName}`);
    }
    html += `Material: ${materials.join(', ')}`;
}

Why loop? An artwork can be made from multiple materials:

Bronze
Steel
Paint
Wood

The process:

Create an empty array: materials = []
Loop through all P186 claims
For each claim, get the material ID
Fetch the label for that material
Create an HTML link and add to array
Join all materials with commas

Result:
Material: Bronze, Steel

Understanding await in a loop:
for (let claim of entity.claims.P186) {
    const materialName = await getWikidataLabel(materialId);  // Waits for each request
    materials.push(...);
}

Important: Each await pauses until the request completes. With many materials, this could be slow. For better performance, use Promise.all():
const materialPromises = entity.claims.P186.map(claim => 
    getWikidataLabel(claim.mainsnak.datavalue.value.id)
);
const materialNames = await Promise.all(materialPromises);  // Fetch all at once!

7. Building Rich HTML Content
html += `Creator: ${creatorName}`;

Template literals make it easy to build complex HTML:
Components:

Creator: - Bold label
 - Link that opens in new tab
${creatorName} - Variable interpolation
 - Close tags

Result (when rendered):
Creator: Mark di Suvero
Understanding Wikidata's Data Structure
Anatomy of a claim:
{
  "mainsnak": {
    "snaktype": "value",
    "property": "P170",
    "datatype": "wikibase-item",
    "datavalue": {
      "value": {
        "entity-type": "item",
        "numeric-id": 315277,
        "id": "Q315277"
      },
      "type": "wikibase-entityid"
    }
  }
}

Path to extract the ID:
claim.mainsnak.datavalue.value.id

Different data types:
Item reference (P170, P186):
value.id  // "Q315277"

String (P1476 - title):
value  // "Gay Liberation"

Time (P571 - inception):
value.time  // "+1980-01-01T00:00:00Z"

Quantity (P2048 - height):
value.amount  // "+4.5"
value.unit    // "http://www.wikidata.org/entity/Q11573"

Complete Data Flow Example
When user clicks on "Gay Liberation" sculpture:

Click handler calls displayWikidataInfo("Q16270988")
Fetch https://www.wikidata.org/wiki/Special:EntityData/Q16270988.json
Parse JSON response
Extract image (P18) → "Gay Liberation sculpture 04.jpg"
Extract label → "Gay Liberation"
Extract description → "sculpture by George Segal"
Extract creator (P170) → "Q500837"
Call getWikidataLabel("Q500837")
Fetch https://www.wikidata.org/wiki/Special:EntityData/Q500837.json
Parse JSON → "George Segal"


Extract inception (P571) → "+1980-01-01T00:00:00Z" → "1980"
Extract materials (P186) → ["Q34095"]
Call getWikidataLabel("Q34095")
Fetch and parse → "Bronze"


Build HTML with all information
Update panel with innerHTML

Total API requests: 3-5 (depending on number of materials)
Performance Considerations
Multiple async requests:
// Sequential (slower)
const creator = await getWikidataLabel(creatorId);     // Wait
const material = await getWikidataLabel(materialId);   // Wait
// Total time: Request1 + Request2

// Parallel (faster)
const [creator, material] = await Promise.all([
    getWikidataLabel(creatorId),
    getWikidataLabel(materialId)
]);
// Total time: Max(Request1, Request2)

Caching labels:
const labelCache = {};

async function getWikidataLabel(itemId) {
    if (labelCache[itemId]) {
        return labelCache[itemId];  // Return cached value
    }

    // ... fetch logic ...

    labelCache[itemId] = label;  // Store in cache
    return label;
}

Try It Yourself

Copy the complete code into step-09.html
Ensure styles_wikidata.css exists
Open in your browser
Click different artworks

You should now see comprehensive information about each artwork!
Experiments
Add more properties:
// Location (P276)
if (entity.claims.P276) {
    const locationId = entity.claims.P276[0].mainsnak.datavalue.value.id;
    const locationName = await getWikidataLabel(locationId);
    html += `Location: ${locationName}`;
}

// Height (P2048)
if (entity.claims.P2048) {
    const height = entity.claims.P2048[0].mainsnak.datavalue.value.amount;
    const unit = entity.claims.P2048[0].mainsnak.datavalue.value.unit;
    html += `Height: ${height} meters`;
}

Format dates differently:
const dateOptions = { year: 'numeric', month: 'long', day: 'numeric' };
const date = new Date(dateValue);
const formatted = date.toLocaleDateString('en-US', dateOptions);
// Result: "January 1, 1980"

Add loading indicators:
async function displayWikidataInfo(wikidataId) {
    const panel = document.getElementById('wikidata-panel');
    panel.innerHTML = 'Loading...';

    // ... fetch and display code ...
}

Group properties by category:
html += 'Basic Information';
// ... label, description ...

html += 'Creator Information';
// ... creator, date ...

html += 'Physical Properties';
// ... materials, dimensions ...

Connection to Digital Stacks
This complete application works seamlessly with SDR:
Your local project/
├── index.html (with all Wikidata integration)
├── styles_wikidata.css
└── collection/
    ├── stanford_campus_irg.tif
    ├── stanford_campus.geojson
    └── stanford_public_art.geojson

After SDR deposit → DRUID: abc123xyz456

Deployed at:
https://stacks.stanford.edu/file/druid:abc123xyz456/index.html

Works because:
✓ All local files use relative paths

**Related resources:**
- Stanford Digital Repository: https://sdr.stanford.edu/
- Stanford Libraries APIs: https://api.library.stanford.edu/
- Stanford Geospatial Center: https://gis.stanford.edu/
✓ External APIs (Wikidata, OpenStreetMap) use absolute URLs
✓ JavaScript executes client-side
✓ No server-side processing needed
Advantages of this approach:

Data stays current (Wikidata updates automatically)  
Minimal deposit size (no duplicate data storage)  
Rich, linked information  
Works anywhere, including SDR  
No API keys required  

Best Practices Demonstrated

Modular code - Helper functions separate concerns  
Error handling - Try-catch prevents crashes  
Defensive programming - Check if data exists  
User feedback - Show loading states and errors  
Semantic HTML - Proper structure and classes  
Accessibility - Alt text, descriptive links  
Performance awareness - Async operations  
Code reusability - Same helpers work for any property  

What's Next?
You now have a complete, working interactive map application that:

Displays a custom map with COG imagery
Shows artwork locations from GeoJSON
Fetches rich data from Wikidata
Displays images from Wikimedia Commons
Presents comprehensive information in a clean layout
Works perfectly when deployed to Stanford Digital Repository

Possible enhancements:

Add search functionality
Implement filtering by artist or date
Create a gallery view
Add image carousels for multiple images
Integrate with other APIs (OpenStreetMap, Wikipedia)
Add map layers for different datasets
Create print-friendly views
Add social sharing features

Deployment:

Prepare your files (HTML, CSS, GeoJSON, GeoTIFF)
Submit to SDR with appropriate metadata
Receive your DRUID
Share: https://stacks.stanford.edu/file/druid:YOUR_DRUID/index.html

Key Takeaways

Linked data connects related entities across a knowledge base  
Helper functions reduce code duplication and improve maintainability  
Async/await handles multiple dependent API calls cleanly  
Different properties require different data extraction strategies  
Regex is useful for parsing formatted strings like dates  
Looping with await fetches data sequentially (consider Promise.all() for parallel)  
Building rich, dynamic interfaces requires careful HTML construction  
External APIs enhance local data without bloating deposits  
Comprehensive applications can be built with client-side JavaScript  
SDR provides stable, long-term hosting for interactive web applications  

Common Questions
Q: How do I find other Wikidata properties?A: Browse an item on Wikidata.org, or check the Wikidata property list.
Q: Can I contribute to Wikidata?A: Yes! Wikidata is open for anyone to edit. Create an account and start contributing.
Q: What if an item has no English label?A: Modify getWikidataLabel() to fall back to other languages:
return entity.labels.en?.value || entity.labels.es?.value || entity.labels.fr?.value || itemId;

Q: Are there rate limits?A: Wikidata is generous, but don't make hundreds of rapid requests. Consider caching.
Q: Can I edit Wikidata programmatically?A: Yes, with authentication. See Wikidata API documentation.
Q: How do I handle items with incomplete data?A: Use defensive checks (if (entity.claims.P170)) as shown in this tutorial.
Q: What about copyright for images?A: Wikimedia Commons files have licenses. Check each file's license page for specific terms.

